            StringBuilder str=new StringBuilder();
            str.append(.5 * N).append('=');
            for (int j = 0; j < N; ++j) {
                str.append("+s").append(j + N * i);
            }
            spec.addConstraint(str.toString());
        }
        spec.addConstraint("0=s2+2*s6-s10-s18");
        spec.addConstraint("0=s4+2*s11-s18");

